from base64 import b64encode
from PySide6.QtCore import QByteArray
from PySide6.QtGui import QPixmap, QIcon

ICON_EDA = b''

ICON_DEL = b''
ICON_PIN = b''
ICON_GND = b''
ICON_RECT = b''
ICON_RES = b''
ICON_CAP = b''
ICON_DIO = b''
ICON_IND = b''
ICON_CMD = b''
ICON_CMT = b''
ICON_VSRC = b''
ICON_WIRE = b''
ICON_WNAME = b''

ICON_FIT = b''
ICON_ZOOM = b''
ICON_GRID = b''
ICON_ROT = b''
ICON_MIR = b''

ICON_NETLIST = b''
ICON_RUN = b''

TRADEMARK = b''

ICONS = {'eda': ICON_EDA,
         'del': ICON_DEL,
         'pin': ICON_PIN,
         'gnd': ICON_GND,
         'res': ICON_RES,
         'cap': ICON_CAP,
         'dio': ICON_DIO,
         'ind': ICON_IND,
         'cmd': ICON_CMD,
         'cmt': ICON_CMT,
         'fit': ICON_FIT,
         'run': ICON_RUN,
         'mir': ICON_MIR,
         'rot': ICON_ROT,
         'vsrc': ICON_VSRC,
         'wire': ICON_WIRE,
         'rect': ICON_RECT,
         'grid': ICON_GRID,
         'zoom': ICON_ZOOM,
         'wname': ICON_WNAME,
         'netlist': ICON_NETLIST,
         }

def getBase64(png):
    with open(png, 'rb') as img:
        print(b64encode(img.read()))

def getIcon(key):
    data = ICONS.get(key, b'')
    data = QByteArray.fromBase64(data)
    pixmap = QPixmap()
    pixmap.loadFromData(data)
    return QIcon(pixmap)

def getTrademark():
    data = QByteArray.fromBase64(TRADEMARK)
    pixmap = QPixmap()
    pixmap.loadFromData(data)
    return pixmap